import React from "react";
import {UserItem} from './Follow'

const Profile= function(props){
let myDetails={props}
let userList={props}

userList=[{
  username:'a.lover',
  name:'akshay neje'

},
{
  username:'onkar',
  name:'onkar kadam'
},
{
  username:'praju',
  name:'prajakta mali'

}]
myDetails={
  username:'me',
  tweets:0,
  follower:0,
  following:0

}
  return(
    <div>
      <div className="flex">
        <div id="profile" className="w-98 flex-1 justify">
          <img
          src={myDetails.avatarUrl}
          alt={myDetails.username}
          className="h-4 w-4 rounded-full object-cover mr-4"
          />
        </div>
        <div className="flex">
          <div id="my-tweets" className="flex-auto">
            <p>{myDetails.tweets}</p>
            <p>Tweets</p>
          </div>
          <div id="follower" className="flex-auto">
            <p>{myDetails.follower}</p>
            <p>Followers</p>
          </div>
          <div id="following" className="flex-auto">
            <p>{myDetails.following}</p>
            <p>Following</p>
          </div>
        </div>
        </div>
        <div id="list">
          
          {
            userList.map(element => {
             
              return <UserItem key={element.id} userDetails={element}/>
            })
          }

        </div>
          
     
    </div>
  )
}

export {Profile}
